import React, {useEffect} from "react";
 

const  Movies = () => {
    const imgApi = ("https://image.tmdb.org/t/p/w1280/");

    const getMoviesVid = async () => {
        const resp = await fetch("https://api.themoviedb.org/3/discover/movie?sort_by=popularity.desc&api_key=fec79be029eaa0a5759cc99d46d4debb");
        const realData = await resp.json();
        console.log(realData.results);
    }
        useEffect(() => {
            getMoviesVid ();
             
        }, []);

  return (
      <>
      <h2>Roshan Thakur Is the world Websites</h2>
       <div className="container-fluid mt-5">
             <div className="main-heading">
                 <h1 className="mb-5 text-center "><span className="font-weight-bold">India </span>Covid-19 DashBoard</h1>
             </div>

             <div className="table-responsive">
                 <table className="table table-hover">
                     <thead className="thead-dark">
                         <tr>
                             <th>State</th>
                             <th>confirmed</th>
                             <th>recovered</th>
                             <th>death</th>
                             <th>active</th>
                             <th>updates</th>
                         </tr>
                     </thead>
                     <tbody>
                         {
                             data.map((curEle, ind)=> {
                                 return (
                                     <tr key={ind}>
                                         <td>{curEle.state}</td>
                                         <td>{curEle.confirmed}</td>
                                         <td>{curEle.recovered}</td>
                                         <td>{curEle.deaths}</td>
                                         <td>{curEle.active}</td>
                                         <td>{curEle.lastupdatedtime}</td>
                                     </tr>
                                 )
                             })
                         }
                          
                     </tbody>
                 </table>
             </div>
         </div>
        </> 
    );
}

export default  Movies;
